import React from "react";
import "./Plans.css";

function Plans() {
  return (
    <dif className="plans-container">
      <div className="programs-header">
        <span>Ready to Start</span>
        <span>Your journey</span>
        <span>Now withus</span>
      </div>
    </dif>
  );
}

export default Plans;
